 function toggle__dropMenu(btnCategories, categories, ui_selectmenu) {
    this.btnCategories = btnCategories,
    this.categories = categories,
    this.ui_selectmenu = ui_selectmenu;

       var btnCategories = $(btnCategories),
           categories = $(categories),
           ui_selectmenu = $(ui_selectmenu);

       $(document).click(function (e) { //    -
         if ( ! $(btnCategories).is(e.target) && $(btnCategories).has(e.target).length === 0 &&
              //       
              ! $(categories).is(e.target) && $(categories).has(e.target).length === 0 &&
              //      
              ! $(ui_selectmenu).is(e.target) && $(ui_selectmenu).has(e.target).length === 0 
              //       
              ) {
               if (categories.hasClass("comparison-person__action")) {
                  $(categories).removeClass("comparison-person__action_show-filter"); //  
               } else if (categories.hasClass("calendary-filter")) {
                  $(categories).removeClass("calendary-filter_opened");
                  $(btnCategories).removeClass("calendary-header__filter-open_opened")
               } else if (categories.hasClass("newsFilter")) {
                  $(categories).removeClass("newsFilter_show");
                  $(".filter-btn-open").removeClass("filter-btn-open_opened");
               } else if (categories.hasClass("search-link__input")) {
                  $(categories).removeClass("show");
                  $(".header-body__content").removeClass("search-active")
               } else {
                  $(categories).removeClass("hide");
               }
           }
        });
 }
