window.addEventListener("load", function() {
    let scroll_x_activited = document.querySelector(".scroll-x_activited");
    let scroll_qj = document.querySelectorAll(".scroll-x");
    for(let i = 0; i <= scroll_qj.length; i++){
        if (scroll_qj[i] != null){
            function Scroll() {
                function scrollHorizontally(e) {
                    e = window.event || e;
                    var delta = Math.max(-1, Math.min(1, (e.wheelDelta || -e.detail)));
                    scroll_qj[i].scrollLeft -= (delta*20); 
                    e.preventDefault();
                }
                if (scroll_qj[i].addEventListener) {
                    // IE9, Chrome, Safari, Opera
                    scroll_qj[i].addEventListener("mousewheel", scrollHorizontally, false);
                    // Firefox
                    scroll_qj[i].addEventListener("DOMMouseScroll", scrollHorizontally, false);
                } else {
                    // IE 6/7/8
                    scroll_qj[i].attachEvent("onmousewheel", scrollHorizontally);
                }
            };
            Scroll();
        }
    }
})

