var input = document.querySelector("#phone");

if (input != null) {

input.oninput = function(){
    this.value = this.value.replace(/[^\d]/g,'');
}

// initialise plugin
var iti = window.intlTelInput(input, {
  utilsScript: "../../js/utils.js?1613236686837",
  preferredCountries: ["ru", "ua"],
  allowExtensions: true
});



var resetMaxLength = function() {
  input.removeAttribute("maxlength", "")
  console.log("reset maxlength")
  input.value = '';
}
// on blur: validate
input.addEventListener('input', function(e) {
    let this_leng = this.value.length;
  if (input.value.trim()) {
    if (iti.isValidNumber()) {
      this.setAttribute("maxlength", +this_leng)
      console.log(`maxlength ${this_leng} IsValid`)
    } else {
      input.classList.add("error");
      var errorCode = iti.getValidationError();
      if (errorCode == 3 || errorCode === 3) {
            this.setAttribute("maxlength", +this_leng);
            console.log(`maxlength ${this_leng} ErrorValid`)
        }
    }
  }
});
var itiCountry = $(".iti__country");
$(itiCountry).on("click", function() {
  resetMaxLength();
})


}




